    def __init__(self, data=None):
        self.data = data
        self.next = None
        self.prev = None

def entance(head):
    if head is None and head.next is None:
        return head
    current = head
    while current:
        temp = current.prev
        current.prev = current.next
        current.next = temp
        current = current.prev
    return temp.prev if temp else None

